import React from 'react';
import logo from './logo.svg';
import './App.css';
import Starwars from './Starwars'
import Searchbar from './Searchbar'
import SearchResult from './SearchResult'
function App() {
  return (
    <div className="App">
      <header>
        <Searchbar />
      </header>
      <Starwars />
      <SearchResult />
    </div>
  );
}

export default App;
